	"ui5lab/browser/view/Home.view.xml":'<mvc:View\n\tcontrollerName="ui5lab.browser.controller.Home"\n\txmlns="sap.m"\n\txmlns:core="sap.ui.core"\n\txmlns:mvc="sap.ui.core.mvc"><Page id="page"><customHeader><Toolbar><ToolbarSpacer/><core:Icon src="sap-icon://lab"/><Title text="{i18n>homeViewTitle}"/><ToolbarSpacer/><Button icon="sap-icon://sys-help" press="onHelp" tooltip="{i18n>helpButtonText}" visible="{appView>/helpVisible}"/></Toolbar></customHeader><content><Panel\n\t\t\t\tid="projects"\n\t\t\t\tclass="sapUiResponsiveMargin sapUiNoContentPadding"\n\t\t\t\twidth="auto"><headerToolbar><OverflowToolbar height="3rem"><Title text="{homeView>/title}"/><ToolbarSpacer /><SearchField\n\t\t\t\t\t\t\tid="searchField"\n\t\t\t\t\t\t\tliveChange="onSearch"\n\t\t\t\t\t\t\twidth="auto"></SearchField><SegmentedButton\n\t\t\t\t\t\t\twidth="{= ${device>/support/touch} ? \'5.0625rem\' : \'4.0625rem\'}"\n\t\t\t\t\t\t\tselectedKey="grid"\n\t\t\t\t\t\t\tselect="onSelect"><items><SegmentedButtonItem icon="sap-icon://grid" key="Grid"/><SegmentedButtonItem icon="sap-icon://list" key="Table"/></items><layoutData><OverflowToolbarLayoutData priority="NeverOverflow"/></layoutData></SegmentedButton></OverflowToolbar></headerToolbar><content></content></Panel></content><MessageStrip\n\t\t\tclass="sapUiResponsiveMargin"\n\t\t\ttext="UI5Lab is a community-driven custom repository. This sample browser is filled automatically with the individual packages of the UI5lab community projects. The samples and codebase of each community project is owned, governed and maintained by the individual repository owners. For more information check the corresponding project repository. Feel free to contribute and list your projects:"\n\t\t\ttype="Information"\n\t\t\tshowIcon="true"\n\t\t\tcustomIcon="sap-icon://sap-ui5"><link><Link\n\t\t\t\t\ttext="UI5Lab"\n\t\t\t\t\ttarget="_blank"\n\t\t\t\t\thref="https://github.com/UI5Lab/UI5Lab-central" /></link></MessageStrip></Page></mvc:View>\n',
	"ui5lab/browser/view/HomeGrid.view.xml":'<mvc:View\n\t\tcontrollerName="ui5lab.browser.controller.HomeGrid"\n\t\txmlns="sap.m"\n\t\txmlns:core="sap.ui.core"\n\t\txmlns:layout="sap.ui.layout"\n\t\txmlns:mvc="sap.ui.core.mvc"><layout:BlockLayout\n\t\t\tid="grid"\n\t\t\tcontent="{homeView>/libraryRows}"\n\t\t\tbackground="Light"><layout:BlockLayoutRow\n\t\t\t\tcontent="{homeView>}"><core:Fragment fragmentName="ui5lab.browser.view.BlockLayoutCell" type="XML" /></layout:BlockLayoutRow></layout:BlockLayout><Text\n\t\tid="nodata"\n\t\ttext="{i18n>homeNoDataText}"\n\t\tvisible="false"\n\t\twidth="calc(100% - 2rem)"\n\t\ttextAlign="Center"\n\t\tclass="sapUiSmallMargin"/></mvc:View>\n',
